import React from "react";
import logo from "../images/tinder_logo_white.png";
import colorLogo from "../images/color-logo-tinder.png";

function Nav() {

  const minimal = true;

  return (
    <nav>
      <div className="logo-container">
        <img className="logo" src={minimal ? colorLogo : logo} alt="" />
      </div>
    </nav>
  );
}

export default Nav;
